import PreLoader1 from './components/PreLoader1';
import PreLoader2 from './components/PreLoader2';


function App() {
  const [loading, setloading] = useState(false);

  useEffect(() => {
    setLoading(true)
    setTimeout(() => {
      setLoading(false)
    }, 8000);
  })
  return (
    <div className="App">
      <header className="App-header">
        <PreLoader1 />
      </header>
    </div>
  );
}

export default App;
